import React , { Component } from 'react';


class Header extends Component {
  render() {
    return (
      <div className="container-fluid">
        <div className="row">
          <div className="col-md-5 offset-md-5" >
            <div className="page-header">
            <h1>Count: {this.counter.count} Increment size: {this.props.jump}</h1>
              <h2>Dart Player Draft List <span><button type="button" onClick={this.incrementCount}>Increment</button></span></h2>
            </div>
          </div>
        </div>
      </div>  
    ) ;
  }
}

export default Header;
